let Sides = (props) =>{
    let  source  = props.source;
    console.log(source);
    return(
        <div className="image-container" style={{ width: '100%',
            display: 'flex',
            justifyContent: 'center' }}>
                    <img src={source} style={{  maxWidth: '100%',
    height: 'auto' }} alt="Image" />
                </div>
    )
}
export default Sides;
